"""![Untitled-5.png](data:image/png;base64,)

These results match somewhat closely with our distribution analysis. We see that u, g, r, i, z, redshift, plate, and MJD seem to be the most important feautres. Of these, we will drop MJD, since plate and MJD are highly correlated.

**Note:** This is also the case for u/g and i/z respectively, however removing those led to poor results.

## Outlier Removal and Feature Selection
We can now remove outliers and select features, based on our EDA above.
"""

# Copy data to avoid changing original
tX0 = tX.copy()
tY0 = tY.copy()
vX0 = vX.copy()

# Manual outlier removal
outlier_thresholds = { # [min, max]
  'alpha': None,
  'delta': None,
  'u': [0, 50],
  'g': [0, 50],
  'r': [0, 50],
  'i': [0, 50],
  'z': [0, 50],
  'run_ID': None,
  'cam_col': None,
  'field_ID': None,
  'redshift': None,
  'plate': None,
  'MJD': None,
  'fiber_ID': None
}
# Set outliers to NaN
for feature, thresholds in outlier_thresholds.items():
  if thresholds is not None:
    min_val = thresholds[0]
    max_val = thresholds[1]
    if min_val is not None:
      tX0.where(tX0[feature]>min_val, np.NaN, inplace=True)
    if max_val is not None:
      tX0.where(tX0[feature]<max_val, np.NaN, inplace=True)
# Remove NaN
non_nan_idx = np.logical_not(tX0.isna().any(axis=1))
tX0 = tX0.loc[non_nan_idx]
tY0 = tY0.loc[non_nan_idx]

# Remove unused columns
used_cols = ['u', 'g', 'r', 'i', 'z', 'redshift', 'plate']
unused_cols = [col for col in tX0.columns if col not in used_cols]
tX0 = tX0.drop(columns=unused_cols)
vX0 = vX0.drop(columns=unused_cols)

# Preview result
tX0.head()

"""## Subsampling
Here, we subsample the data for local experimentation and cross-validation.
"""

# Subsample for training and testing (sample more when doing cross-validation)
num_train_samples = 75000 # Number of samples to train models on
num_folds = 2             # Number of folds for cross_validation
if do_cross_validation:
  sample_size = round(num_train_samples * num_folds / (num_folds - 1))
  assert sample_size <= len(tX0), 'Insufficient data'
  tX0_in = tX0.sample(sample_size, random_state=7)
  tY0_in = tY0[tX0_in.index]
else:
  assert num_train_samples <= len(tX0), 'Insufficient data'
  tX0_in = tX0.sample(num_train_samples, random_state=7)
  tY0_in = tY0[tX0_in.index]

# Preview result
tX0_in.head()

"""## Model Training
Based on our experimentation, we can now train our final model, with tuned hyperparameters, on all the data.
"""

from sklearn.pipeline import Pipeline
from sklearn.preprocessing import PolynomialFeatures
from sklearn.preprocessing import StandardScaler
from sklearn.linear_model import SGDClassifier
from sklearn.model_selection import cross_validate

# Create model pipeline
m = Pipeline(steps=[
    ("preproc", PolynomialFeatures(3)),
    ("scaler", StandardScaler()),
    ("est", SGDClassifier(loss='log_loss', penalty='l2', alpha=1e-6,
                          max_iter=250, random_state=7, class_weight='balanced'))
])

# Train model
if do_cross_validation:
  scores = cross_validate(m, tX0_in, tY0_in, scoring="accuracy", cv=num_folds, return_estimator=True)
  print(f"Predicted score: {scores['test_score'].mean().round(5)} +/- {scores['test_score'].std().round(5)}")
  best_model_idx = np.argmax(scores['test_score'])
  m = scores['estimator'][best_model_idx]
else:
  m.fit(tX0_in, tY0_in)

"""## Generate and Post-Process Predictions
Finally, we can generate our predictions for submission.
"""

pY = pd.DataFrame(m.predict(vX0), index=range(1,len(vX0)+1), columns=['Class'])  # ensure that labels and observations are in corresponding order
df.Class.fillna('unknown').value_counts()   # distribution of all train labels
pY.value_counts()                           # distribution of predicted labels
ToCSV(pY, 'üååBaseline')

